import "./App.css";
import React from "react";
import Nav from "./Nav";
import Home from "./Home";
import Main from "./Main";
import InputPage from "./InputPage";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Nav />
      <Router>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
